import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';
import Button from 'react-bootstrap/Button';
import Popover from 'react-bootstrap/Popover';
import './ScriptList.css';

function ScriptList({ scripts, onScriptSelect }) {
    return (
        <div>
            <ListGroup
                className='script-list'
                defaultActiveKey='#link0'
                onClick={onScriptSelect}
            >
                {scripts.map((item, i) => {
                    return (
                        <ListGroup.Item action href={`#link${i}`} key={i}>
                            {item.name}
                        </ListGroup.Item>
                    );
                })}
            </ListGroup>

            <div className='script-list-buttons'>
                <Button className='create-button' variant='outline-primary'>
                    Create New Script
                </Button>
                <Button className='rename-button' variant='outline-primary'>
                    Rename
                </Button>
            </div>
        </div>
    );
}

export default ScriptList;
